import React from 'react'
import { useLocation } from 'react-router-dom'

const Wallet = () => {
    const location = useLocation();
        return (
      <div>
        <h1>Welcome to your Wallet</h1>
        <h3>{location.state.username}</h3>
      </div>
    );
};
export default Wallet;
